import { useEffect, useState } from "react";
import axios from "axios";

const OrderPage = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8080/api/orders")
      .then(response => setOrders(response.data))
      .catch(error => console.error("Error fetching orders:", error));
  }, []);

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold mb-4">My Orders</h1>
      {orders.length === 0 ? (
        <p className="text-gray-600">No orders yet. Start ordering now!</p>
      ) : (
        <div className="space-y-4">
          {orders.map(order => (
            <div key={order.id} className="p-4 border rounded-lg shadow-md">
              <h2 className="text-lg font-semibold">Order #{order.id}</h2>
              <p>Status: <span className="font-bold text-blue-600">{order.status}</span></p>
              <p>Total: <span className="font-bold">${order.total}</span></p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default OrderPage;
